const field1 = context.component?.variables?.['a5bc10e4-874d-4fa3-b50a-f21ae369bd63-value']?.trim() || "";
const field2 = context.component?.variables?.['3c6bfd7e-85cb-4f43-ac9c-afe288907ad6-value']?.trim() || "";
const email  = context.component?.variables?.['db3baf0e-3d35-4a31-bad1-d6e587511cde-value']?.trim() || "";
const field4 = context.component?.variables?.['37fa2b96-ac75-4c81-ab92-2b4aff721aef-value']?.trim() || "";

// Validaciones para el campo de contraseña (field4)
const isValidPassword =
  field4.length >= 8 &&        // mínimo 8 caracteres
  /[A-Z]/.test(field4) &&      // al menos una letra mayúscula
  /[^A-Za-z0-9]/.test(field4); // al menos un carácter especial

return (
  field1 !== "" &&
  field2 !== "" &&
  field4 !== "" &&
  isValidPassword &&
  (email !== "" && wwFormulas.isEmail(email))
);
